import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom'; 
import './index.css';
import reportWebVitals from './reportWebVitals';
import 'mdb-react-ui-kit/dist/css/mdb.min.css';
import ProductBox from"./components/main/info/Info";

const tecidoImg = "https://via.placeholder.com/400x400.png?text=Tecido+Produto";

function App() {
  return (
    <div>
      <ProductBox
        imageUrl={tecidoImg}
        description="Tecido leve e respirável, ideal para máxima performance. Tecnologia que garante conforto e liberdade de movimento durante o uso."
      />
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>  
      <App />
    </BrowserRouter>
  </React.StrictMode>
);

export default App;

reportWebVitals();
